    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1963. The report begins by summarizing the weather, water, and habitat conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, fish, and
    reptiles- is also covered. The Refuge development and maintenance section discusses
    physical development, plantings, and collections and receipts. Resource management
    is outlined; topics include grazing, haying, fur harvesting, and commercial fishing.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and violations. Items of interest, N-R forms, and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
